-- ----------------------------
-- Procedure structure for eventoentre
-- ----------------------------
DROP PROCEDURE IF EXISTS `eventoentre`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `eventoentre`(IN inicio DATETIME, IN fin DATETIME, IN anonimus INT)
BEGIN
set @color= '#fff';
SET @backgroundColor= '#0E1A5C';
SET @borderColor = '#000';
SET @textColor = '#fff';
SET @allDay = 0; 

IF anonimus = 0 THEN

(SELECT idTurno AS id, CONCAT('Turno: ', nombre, ' ', apellido) AS 'title',@allDay as 'allDay', 
FechaHoraIni AS 'start', FechaHoraFin AS 'end', @color AS 'color', @backgroundColor AS 'backgroundColor', 
@borderColor AS 'borderColor', @textColor AS 'textColor', Observaciones as descripcion 
FROM turno a INNER JOIN usuarios b ON b.idUsuario = a.IdPaciente WHERE FechaHoraIni BETWEEN inicio AND fin);

ELSE

(SELECT idTurno AS id, CONCAT('Turno: ', 'Ocupado') AS 'title',@allDay as 'allDay', 
FechaHoraIni AS 'start', FechaHoraFin AS 'end', @color AS 'color', @backgroundColor AS 'backgroundColor', 
@borderColor AS 'borderColor', @textColor AS 'textColor', Observaciones as descripcion 
FROM turno a INNER JOIN usuarios b ON b.idUsuario = a.IdPaciente AND b.idUsuario <> anonimus WHERE FechaHoraIni BETWEEN inicio AND fin)
UNION
(SELECT idTurno AS id, CONCAT('Turno: ', nombre, ' ', apellido) AS 'title',@allDay as 'allDay', 
FechaHoraIni AS 'start', FechaHoraFin AS 'end', @color AS 'color', @backgroundColor AS 'backgroundColor', 

@borderColor AS 'borderColor', @textColor AS 'textColor', Observaciones as descripcion 
FROM turno a INNER JOIN usuarios b ON b.idUsuario = a.IdPaciente  AND b.idUsuario = anonimus WHERE FechaHoraIni BETWEEN inicio AND fin);

END IF;

END
;;
DELIMITER ;
