values(OLD.idTurno, OLD.idPaciente, OLD.FechaHoraIni, OLD.FechaHoraFin, OLD.idProfesional, OLD.Observaciones, OLD.PrecioActual, OLD.sobreturno, OLD.idobrasocial, OLD.estado, OLD.AU_usuario, OLD.AU_fechahora, OLD.AU_accion)
;;
